                                                                                    $::NamedArgument,
                                                                                    "new",
                                                                                    {   _argument_name_ => ::DISPATCH( $::Str, 'new', 'invocant' ),
                                                                                        value           => $::Undef,
                                                                                    }
                                                                                ),
                                                                                ::DISPATCH(
                                                                                    $::NamedArgument,
                                                                                    "new",
                                                                                    {   _argument_name_ => ::DISPATCH( $::Str, 'new', 'positional' ),
                                                                                        value => ::DISPATCH( $::Array, "new", { _array => [] } ),
                                                                                    }
                                                                                ),
                                                                                ::DISPATCH(
                                                                                    $::NamedArgument,
                                                                                    "new",
                                                                                    {   _argument_name_ => ::DISPATCH( $::Str, 'new', 'named' ),
                                                                                        value => ::DISPATCH( $::Hash, "new", { _hash => {} } ),
                                                                                    }
                                                                                ),
                                                                            ),
                                                                        }
                                                                    ),
                                                                    ::DISPATCH(
                                                                        $::NamedArgument,
                                                                        "new",
                                                                        {   _argument_name_ => ::DISPATCH( $::Str, 'new', 'body' ),
                                                                            value           => $module,
                                                                        }
                                                                    ),
                                                                ),
                                                            }
                                                        ),
                                                    )
                                                    )
                                            }
                                        }
                                        else { ::DISPATCH( $::Bit, "new", 0 ) }
                                        }
                                }
                            }
                            else { ::DISPATCH( $::Bit, "new", 0 ) }
                        };
                        return ($::Undef);
                    },
                    signature => ::DISPATCH(
                        $::Signature,
                        "new",
                        {   invocant => $::Undef,
                            array    => ::DISPATCH(
                                $::Array, "new",
                                {   _array => [
                                        ::DISPATCH( $::Signature::Item, "new", { sigil => '$', twigil => '', name => 'node',      namespace => [], } ),
                                        ::DISPATCH( $::Signature::Item, "new", { sigil => '$', twigil => '', name => 'node_name', namespace => [], } ),
                                    ]
                                }
                            ),
                            hash   => ::DISPATCH( $::Hash, "new", { _hash => {} } ),
                            return => $::Undef,
                        }
                    ),
                }
            )
            )
    };
    1
}
